window.bookSummaryJSON = "<p><b>#1 NATIONAL BESTSELLER • Lisbeth Salander and Mikael Blomkvist return to the Girl in the Dragon Tattoo series in this ripped-from-the-headlines, high-octane follow-up to Stieg Larsson's </b><b><i>The Girl Who Kicked the Hornet's Nest</i></b><b>.&nbsp;• Also known as the Millennium series<br> <br> “Rest easy, Lisbeth Salander fans—our punk hacker heroine is in good hands.… A twisty, bloody thrill ride.… An instant page-turner.” —</b><b><i>USA Today</i></b><i><br> <br> </i>The next installment in the Millennium series: a genius hacker who has always been an outsider; a journalist with a penchant for danger. She is Lisbeth Salander, the girl with the dragon tattoo. He is Mikael Blomkvist, crusading editor of Millennium. One night, Blomkvist receives a call from a source who claims to have been given information vital to the United States by a young female hacker. Blomkvist, always on the lookout for a story, reaches out to Salander for help. She, as usual, has plans of her own. Together they are drawn into a ruthless underworld of spies, cybercriminals, and government operatives—some willing to kill to protect their secrets.<br> <b><br> Look for the latest book in the Girl with the Dragon Tattoo series, </b><b><i>The Girl in the Eagle's Talons</i></b><b>, coming soon!</b></p>"; 
